_reason': None, 'body': 'Hello

We are trying to build a Custom AdMob Adapter and when we want to reward a user we invoke the `GADMediationRewardedAdEventDelegate.didRewardUserWithReward` passing a `GADAdReward` object with `type` and `amount`. 
The reward arriving in the host application's `userDidEarnRewardHandler` of `GADRewardedAd.present` method, has empty `type` and `amount` equals to 1. 
If we chose to override those values from AdMob dashboard in placement settings the reward has the correct values as specified in the dashboard, but this approach does not fit in our case.

Below is an example of the Adapter `didRewardUserWithReward` method

```objc
- (void) onAdCompleteExample:(RewardInfo *)rewardInfo
{
    NSDecimalNumber *rewardValue = [NSDecimalNumber decimalNumberWithString:@"1500"];
    NSString *rewardName = [rewardInfo name];
    
        GADAdReward *adReward = [[GADAdReward alloc] initWithRewardType:rewardName rewardAmount:rewardValue];
        
        id<GADMediationRewardedAdEventDelegate> strongDelegate = self->_adEventDelegate;
        
        [strongDelegate didEndVideo];
        [strongDelegate didRewardUserWithReward:adReward];
}
```


Host App example

```swift
@IBAction func showRewardedAd(_ sender: Any) {
        if (rewardedAd != nil) {
            rewardedAd?.present(fromRootViewController: self) {
                let reward = self.rewardedAd!.adReward
                print("Reward received with currency \(reward.type), amount \(reward.amount)")
            }
        } else {
            print("Ad wasn't ready")
        }
    }
```

We get the following log

`Reward received with currency , amount 1`

We have tried various approaches regarding the `adEventDelegate` and `DecimalNumber` initialization as found in the example and other network adapters such as [here](https://github.com/googleads/googleads-mobile-ios-mediation/blob/3284434c2c702e342d28dbe04186f1862f843661/example/CustomEvent/SampleCustomEventRewarded.m) and [here](https://github.com/googleads/googleads-mobile-ios-mediation/blob/818e7dd7d231860930566b9000bcb4d060e3e7f6/example/Adapter/SampleAdapter.m), but nothing works. We have also tried to dispatch the didRewardUserWithReward in the main thread with no luck. 

The above works as expected on Android.

Is something wrong from our side or is it an issue on AdMob?', 'reactions': {'url': 'https://api.github.com/repos/googleads/googleads-mobile-ios-mediation/issues/347/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/googleads/googleads-mobile-ios-mediation/issues/347/timeline', 'performed_via_github_app': None}}

